webpackJsonp([0x965c4996e201e000],{"./node_modules/json-loader/index.js!./.cache/json/html-tutorials-how-to-use-lists.json":function(s,n){s.exports={data:{markdownRemark:{html:'<h2>How to Use Lists</h2>\n<p>Lists are used to specify a set of consecutive items or related information in well formed and semantic way, such as a list of ingredients or a list of procedural steps.\nHTML markup has three different types of lists - <strong>ordered</strong>, <strong>unordored</strong> and <strong>description</strong> lists. </p>\n<h3>Ordered Lists</h3>\n<p>An ordered list is used to group a set of related items, in a specific order.\nThis list is created with <code>&#x3C;ol></code> tag. Each list item is surrounded with <code>&#x3C;li></code> tag.</p>\n<h5>Code</h5>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>ol</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Mix ingredients<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Bake in oven for an hour<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Allow to stand for ten minutes<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>ol</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<h5>Example</h5>\n<ol>\n    <li>Mix ingredients</li>\n    <li>Bake in oven for an hour</li>\n    <li>Allow to stand for ten minutes</li>\n</ol>\n<h3>Unordered Lists</h3>\n<p>An unordered list is used to group a set of related items, in no particular order. This list is created with <code>&#x3C;ul></code> tag. Each list item is surrounded with <code>&#x3C;li></code> tag.</p>\n<h5>Code</h5>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>ul</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Chocolate Cake<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Black Forest Cake<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span><span class="token punctuation">></span></span>Pineapple Cake<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>ul</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<h4>Example</h4>\n<ul>\n    <li>Chocolate Cake</li>\n    <li>Black Forest Cake</li>\n    <li>Pineapple Cake</li>\n</ul>\n<h3>Description Lists</h3>\n<p>A description list is used to specify a list of terms and their descriptions. This list is created with <code>&#x3C;dl></code> tag. Each list item is surrounded with <code>&#x3C;dd></code> tag.</p>\n<h5>Code</h5>\n<div class="gatsby-highlight">\n      <pre class="language-html"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>dl</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>dt</span><span class="token punctuation">></span></span>Bread<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>dt</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>dd</span><span class="token punctuation">></span></span>A baked food made of flour.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>dd</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>dt</span><span class="token punctuation">></span></span>Coffee<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>dt</span><span class="token punctuation">></span></span>\n    <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>dd</span><span class="token punctuation">></span></span>A drink made from roasted coffee beans.<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>dd</span><span class="token punctuation">></span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>dl</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<h5>Output</h5>\n<dl>\n    <dt>Bread</dt>\n    <dd>A baked food made of flour.</dd>\n    <dt>Coffee</dt>\n    <dd>A drink made from roasted coffee beans.</dd>\n</dl>\n<h4>More Information:</h4>\n<p><a href="https://webplatform.github.io/docs/guides/html_lists/">HTML lists Â· WebPlatform Docs</a></p>',fields:{slug:"/html/tutorials/how-to-use-lists/"},frontmatter:{title:"How to Use Lists"}}},pathContext:{slug:"/html/tutorials/how-to-use-lists/"}}}});
